// components/TodayLog.js
import React from 'react';
import { Card, ListGroup, Button } from 'react-bootstrap';

const TodayLog = ({ foodEntries, onAddFood }) => {
    return (
        <Card className="mb-4">
            <Card.Header>Today's Log</Card.Header>
            <ListGroup variant="flush">
                {foodEntries.map((entry, index) => (
                    <ListGroup.Item key={index}>
                        {entry.name}: {entry.calories} kcal
                    </ListGroup.Item>
                ))}
                <ListGroup.Item>
                    <Button variant="primary" onClick={onAddFood}>Add Food</Button>
                </ListGroup.Item>
            </ListGroup>
        </Card>
    );
};

export default TodayLog;
